  <style>
    /* Ensure all .town-text elements are above other elements */
    .town-text {
      transition: fill 800ms ease; /* Smooth color change */ 
      pointer-events: none; /* Text itself won't block hovering the town */
      paint-order: stroke fill; /* Ensures text stroke/fill order */
    }

    /* Hover effect for text within hovered .town */
    .town:hover .town-text {
      transition: fill 800ms ease; /* Smooth color change */ 
      fill: #232323; 
    }
    /* Make SVG responsive */
    svg { max-width: 100%; height: auto; display: block; }

    /* Show pointer on hoverable groups */
    .town { cursor: pointer; }

    /* Smooth animation for fills (and optional transforms if you decide to add them later) */
    .town [id="town-svg"] { transition: fill 800ms ease, transform 800ms ease; }

    /* On hover, only the child with id="town-svg" in the hovered .town is affected */
    .town:hover [id="town-svg"] { fill: #d0d0d0; }

    /* Optional focus support for keyboard users */
    .town:focus-within [id="town-svg"],
    .town:focus [id="town-svg"] { fill: #d0d0d0; outline: none; }
  
    /* Remove browser focus ring and any stroke "border" on click/focus */
    .town { outline: none; }
    .town:focus, .town:active { outline: none; }
    .town:focus [id="town-svg"], .town:active [id="town-svg"] { stroke: none; }

  
    /* Inner border for lake */
    #lake {
      stroke: #ffffff;
      stroke-width: 1;
      vector-effect: non-scaling-stroke;
    }

  </style>
</head>

  <script>
    // Make .town groups keyboard-focusable for accessibility
    (function() {
      var towns = document.querySelectorAll('.town');
      towns.forEach(function(t){
        // Add tabindex if not present
        if(!t.hasAttribute('tabindex')) t.setAttribute('tabindex', '0');
        // Improve hit area: ensure pointer events on child paths
        t.querySelectorAll('*').forEach(function(n){ n.style.pointerEvents = 'auto'; });
      });
    })();
  </script>

  <script>
    (function () {
      // Wait for DOM and ensure inline SVG is present
      function ready(fn){ if (document.readyState !== 'loading') fn(); else document.addEventListener('DOMContentLoaded', fn); }
      ready(function(){
        var svg = document.querySelector('svg');
        if(!svg) return;

        // Create or reuse a top-level labels layer
        var labelsLayer = svg.querySelector('#labels-layer');
        if(!labelsLayer){
          labelsLayer = document.createElementNS('http://www.w3.org/2000/svg', 'g');
          labelsLayer.setAttribute('id', 'labels-layer');
          // Appending at the end ensures it's painted on top
          svg.appendChild(labelsLayer);
        }

        // Move all .town-text into labels layer to guarantee top stacking
        var texts = svg.querySelectorAll('.town-text');
        texts.forEach(function(txt){
          try {
            labelsLayer.appendChild(txt);
          } catch(e) {
            // In case of foreignObject or other constraints, ignore and continue
          }
        });
      });
    })();
  </script>
